import React from 'react'
import Slide from './main/Slide'
import Subtitle from './main/Catalogs'

export default class Main extends React.Component{
	render(){
		return(
			<div className='main'>
				<Slide/>
				<Subtitle/>
				<Images/>
				<Listas/>
			</div>
		)
	}
}
